import React from 'react'

function Restaurant(){

    const url = 'http://127.0.0.1:5000/api/v1/restaurant'
    const [restaurants,setRestaurants] = useState({},[url])

    useEffect(()=>{
        axios.get(url)
            .then(response =>{
                setRestaurants(response.data)
            })
    }, [url])

    let content = null

    if(restaurants.result){
        content =  
            restaurants.result.map((cafe,key)=>
                <div key = {key}>
                    <Card 
                        info = {cafe}
                    />
                </div>
            )

    }

    return(
        <div>

            <h1>My favorite cafe</h1>
            {content}

        </div>

    )
}

export default Restaurant
